import DepositsHistoryDatagrid from './depositsHistoryDatagrid';

const DepositHistory = () => {
    return (
        <div className="">
            <p className="text-white pe-4">تاریخچه واریزها</p>
            <CardSection />
            <div className="d-flex position-relative">

<Tab.Container id="left-tabs-example" defaultActiveKey="rial">

    <Nav variant="pills" >

        <Nav.Item>

            <Nav.Link role="button" eventKey="rial">واریز تومانی</Nav.Link>

        </Nav.Item>

        <Nav.Item>

            <Nav.Link role="button" eventKey="coin">واریز رمز ارزها</Nav.Link>

        </Nav.Item>

    </Nav>
    <Tab.Content className="mt-lg-3 mt-sm-0 mt-xl-0 w-100">

        <Tab.Pane eventKey="rial">

            <DepositsHistoryDatagrid />

        </Tab.Pane>

        <Tab.Pane eventKey="coin">

            {/* <DepositsCoinDataTable filterDepositKindValue={filterDepositKindValue} filterQoinValue={filterQoinValue} /> */}

        </Tab.Pane>

        </Tab.Content>

</Tab.Container>

</div>
            {/* <DepositsHistoryDatagrid /> */}
        </div>
    );
}

export default DepositHistory;
